import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { Link } from 'react-scroll';  // react-scroll'dan Link bileÅŸenini import ediyoruz
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import Main from './sections/Main';
import About from './sections/About';
import Contact from './sections/Contact';
import './App.css';

const App = () => {
  const [currentPage, setCurrentPage] = useState('home');
  const [isLoginOpen, setIsLoginOpen] = useState(false);
  const [isRegisterOpen, setIsRegisterOpen] = useState(false);
  const [user, setUser] = useState(null);

  const openLogin = () => {
    setIsLoginOpen(true);
    setIsRegisterOpen(false);
  };

  const openRegister = () => {
    setIsRegisterOpen(true);
    setIsLoginOpen(false);
  };

  const closeForms = () => {
    setIsLoginOpen(false);
    setIsRegisterOpen(false);
  };

  return (
    <Router>
      {/* Navbar */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <a className="navbar-brand mx-auto" href="#home">CRM Sistemi</a>
        <div className="collapse navbar-collapse">
          <ul className="navbar-nav ml-auto mx-auto">
            <li className="nav-item">
              <Link className="nav-link" to="home" smooth={true} duration={500}>Ana Sayfa</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="about" smooth={true} duration={500}>HakkÄ±mÄ±zda</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="contact" smooth={true} duration={500}>Ä°letiÅŸim</Link>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#" onClick={openLogin}>GiriÅŸ Yap</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#" onClick={openRegister}>KayÄ±t Ol</a>
            </li>
          </ul>
        </div>
      </nav>

      {/* Sayfa Ä°Ã§eriÄŸi */}
      <Routes>
        <Route path="/" element={<HomePage openLogin={openLogin} openRegister={openRegister} />} />
        <Route path="/main" element={<Main />} />
      </Routes>

      <div id="home">
        <HomePage openLogin={openLogin} openRegister={openRegister} />
      </div>

      <div id="about">
        <About />
      </div>

      <div id="contact">
        <Contact />
      </div>

      {/* Login ve Register FormlarÄ± */}
      {isLoginOpen && (
        <div className="form-popup">
          <button onClick={closeForms} className="close-btn">X</button>
          <LoginPage setUser={setUser} openRegister={openRegister} />
        </div>
      )}

      {isRegisterOpen && (
        <div className="form-popup">
          <button onClick={closeForms} className="close-btn">X</button>
          <RegisterPage openLogin={openLogin} />
        </div>
      )}

      {/* Footer */}
      <footer className="footer bg-dark">
        <p className="text-center text-white">&copy; 2025 CRM Support. TÃ¼m haklarÄ± saklÄ±dÄ±r.</p>
      </footer>
    </Router>
  );
};

export default App;
